import React from 'react'
import AppLoading from './layout/AppLoading'
import AppPageheader from './layout/AppPageheader'

class Configs extends React.Component{
    constructor(){
        super()
        this.state = {
            isLoading: true
        }
    }

    componentDidMount(){
        setTimeout(() => {
            this.setState({isLoading: false})
        }, 2000);

    }

    render(){

        return (
            <div>
                <AppPageheader title="Configure seu Negócio" detail="Precisamos saber mais sobre seu negócio" />
                <div className="page-content container-fluid">
                    <p>{this.state.isLoading ? 'verdade' : 'mentira'}</p>
                </div>
            </div>
        )
    }
}

export default Configs
